import Link from 'next/link';

const Nav = () => {
    return (
        <nav
            style={{ height: "40px", width: "100%", display: "flex", background: "yellow", justifyContent: "space-evenly", padding: "20px"}}
        >
            <Link href={'/index'}><a>Home</a></Link>
            <Link href={'/details'}><a>Skills Details</a></Link>
        </nav>

    )
};

export default Nav;
